import React, {useState} from "react";
import GetAccountByID from "./AccountPage/GetAccountByID";

function HomePage() {

    const [ID, setID] = useState('');

    const handleIDChange = (e) => {
        setID(e.target.value);
    };

    return (
        <div>
            <label><b>User ID</b></label>
            <input type="text" placeholder="Enter ID" name={"ID"} value={ID} onChange={handleIDChange} required/>
            <button type="submit" onClick={GetAccountByID({ID})}>Find account</button>

        </div>
    );
}
export default HomePage;
